import React, { useState } from 'react';
import HeroSection from '../../components/landingpage/HeroSection.js';
import AboutUs from './../../components/landingpage/AboutUs';
import Services from './../../components/landingpage/Services';
import Portfolio from './../../components/landingpage/Portfolio';
import Testimonials from './../../components/landingpage/Testimonials';
import ContactUs from './../../components/landingpage/ContactUs';
import FAQ from './../../components/landingpage/FAQ';
// import "./../../css/landingPage.css";

const LandingPage = () => {
  const [activeTab, setActiveTab] = useState('about');

  const renderTabContent = () => {
    switch (activeTab) {
      case 'about':
        return <AboutUs />;
      case 'services':
        return <Services />;
      case 'portfolio':
        return <Portfolio />;
      default:
        return <AboutUs />;
    }
  };

  return (
    <div>
      <header>
        <nav>
          <ul style={{ display: 'flex', listStyleType: 'none' }}>
            <li style={{ marginRight: '20px', cursor: 'pointer' }} onClick={() => setActiveTab('about')}>About Us</li>
            <li style={{ marginRight: '20px', cursor: 'pointer' }} onClick={() => setActiveTab('services')}>Services</li>
            <li style={{ cursor: 'pointer' }} onClick={() => setActiveTab('portfolio')}>Portfolio</li>
          </ul>
        </nav>
      </header>

      <HeroSection />

      {renderTabContent()}

      <Testimonials />
      <ContactUs />
      <FAQ />
    </div>
  );
};

export default LandingPage;
